  const getDate = (dt: Date) => {
    setDefaultDate(dt);
    console.log(dt.toDateString(), 'date');
  };

  return (
    <DatepickerComponent
      defaultYear={defaultDate.getFullYear()}
      defaultMonth={defaultDate.getMonth() + 1}
      defaultDate={defaultDate.getDate()}
      getDate={getDate}
    />
  );
};

export const Default = Template.bind({});
